import './feature.css'
import graph from "frontend/src/components/assets/EDemand.png";

const Feature = () => {
  return (
  <div className=".graph_border">
    <div className='.row'>
      <img src= {graph} alt="Something's wrong" width = "500px" length = "500px" />
    </div>
  </div>
  )
}

export default Feature;
